  \"2016-07-27T23:05:17.707021\",\n\t\"name\": \"challenge-cost-share-agreement-between-u-s-fish-and-wildlife-service-and-owl-mountain-part\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this Challenge Cost Share
  Agreement is for the Service and the OMP to enter into a cooperative effort to determine
  and evaluate how to best manage meadow and riparian lands on the refuge and adjacent
  lands in the Owl Mountain area through a variety of applied management treatments
  for the benefit of migratory birds and other wildlife, and to improve and maintain
  overall ecosystem health. Both parties will benefit from the cooperative opportunities
  to promote an ecosystem approach to landscape management in protecting, preserving
  and enhancing the Owl Mountain area's resources as well as the development of informational
  and educational materials for public distribution.\",\n\t\"license_title\": \"License
